import React from 'react'; 
import './styles.scss'; 

const Home = () => (
    <div className="home-container">
        <div className="home-content">
            <h1 className="text-title">Conheça o melhor catálogo de produtos.</h1>
        </div>
    </div>
); 

export default Home;
